define(['./forOwn'], function (forOwn) {

    /**
     * Get object values
     */
    /**
     * Description
     * @method values
     * @param {} obj
     * @return vals
     */
    function values(obj) {
        var vals = [];
        forOwn(obj, function(val, key){
            vals.push(val);
        });
        return vals;
    }

    return values;

});
